			<string>UNIVERSAL_OUTPUTFOLDER=${BUILD_DIR}/Debug-universal

if [ "true" == ${ALREADYINVOKED:-false} ]
then
echo "RECURSION: Detected, stopping"
else
export ALREADYINVOKED="true"

# Step 1. Build Device and Simulator versions



xcodebuild -workspace "QredoSDK.xcworkspace" -scheme "QredoXDK" \
ONLY_ACTIVE_ARCH=NO -configuration Debug -sdk iphoneos  \
BUILD_DIR="${BUILD_DIR}" BUILD_ROOT="${BUILD_ROOT}" clean build



xcodebuild -workspace "QredoSDK.xcworkspace" -scheme "QredoXDK" \
-configuration Debug -sdk iphonesimulator  \
ARCHS="i386 x86_64" ONLY_ACTIVE_ARCH=NO \
BUILD_DIR="${BUILD_DIR}" BUILD_ROOT="${BUILD_ROOT}" clean build


mkdir -p "${UNIVERSAL_OUTPUTFOLDER}"


# Step 2. Copy the framework structure (from iphoneos build) to the universal folder
# delete it first otherwise it will be copied inside any existing framework directory
rm -rf "${UNIVERSAL_OUTPUTFOLDER}/QredoXDK.framework"
cp -R "${BUILD_DIR}/Debug-iphoneos/QredoXDK.framework" "${UNIVERSAL_OUTPUTFOLDER}/QredoXDK.framework"


# Step 3. Copy Swift modules (from iphonesimulator build) to the copied framework directory
#cp -R "${BUILD_DIR}/${CONFIGURATION}-iphonesimulator/${PROJECT_NAME}.framework/Modules/${PROJECT_NAME}.swiftmodule/." "${UNIVERSAL_OUTPUTFOLDER}/${PROJECT_NAME}.framework/Modules/${PROJECT_NAME}.swiftmodule"


# Step 4. Create universal binary file using lipo and place the combined executable in the copied framework directory
lipo -create -output "${UNIVERSAL_OUTPUTFOLDER}/QredoXDK.framework/QredoXDK" "${BUILD_DIR}/${CONFIGURATION}-iphonesimulator/QredoXDK.framework/QredoXDK" "${BUILD_DIR}/${CONFIGURATION}-iphoneos/QredoXDK.framework/QredoXDK"

# Step 5. Convenience step to copy the framework to the project's directory
# delete it first otherwise it will be copied inside any existing framework directory
rm -rf "${PROJECT_DIR}/QredoXDK.framework"
cp -R "${UNIVERSAL_OUTPUTFOLDER}/QredoXDK.framework" "${PROJECT_DIR}"

#Insert the version number into a file in the
buildNumber=$(/usr/libexec/PlistBuddy -c "Print CFBundleShortVersionString" "${PROJECT_DIR}/QredoXDK.framework/Info.plist")
echo "{\"version\":\"${buildNumber}\"}" &gt; "${PROJECT_DIR}/version.json"
echo "${buildNumber}" &gt; "${PROJECT_DIR}/version"


# Step 6. Convenience step to open the project's directory in Finder
open "${PROJECT_DIR}"

fi</string>
